     geocoder.geocode({address: address}, function(results, status) {
     	if(fix_jquery)
            jQuery.noConflict();

        if (status == google.maps.GeocoderStatus.OK) 
        {
            if (google_suggest && results.length > 1) { 
                var suggest = "<div class=\"sl_suggest\"><span>" + DID_YOU_MEAN + "</span><ul>";

                for (var i=0; i< results.length; i++) {
                    var p = results[i].geometry.location;
                    suggest += "<li><a href=\"javascript:searchLocationsNearbyLatLng(" + p.lat() + "," + p.lng() + ",'" + results[i].formatted_address + "')\">" + results[i].formatted_address + "</a></li>";
                }

                suggest += "</ul></div>";
                $('sl_sidebar').innerHTML = suggest;
                $('sl_map_spinner').style.display = 'none';
            } else {
                // ===== If there was a single marker =====           
                searchLocationsNear(results[0].geometry.location);
            }
        } else { //implement errors
         if (name_search)
            searchLocationsByName(address);
         else
            clearLocations();
        }});

     if(fix_jquery)
        	$ = jQuery;
   }


