/*main sections-------------------------------------------------*/
#page {/*background: #fea900;*/background:url(../images/images/gradient_05.jpg) repeat bottom left;}

#main {/*background: #fee97e;*/}

#sidebar-a, #sidebar-b {background: #fff;}

