#block-top-a, #block-bottom, #block-top-b {/*background: #460b00;*/background:#f3eeda url(../images/images/gradient_04.jpg) repeat-x bottom left;}

#header, #footer {margin:10px 0 0 0; z-index:99;}

#logo p {margin: 0; padding: 0;}

#footer {padding:5px; /*color:#fea900;*/ font: 14px/20px Arial,Helvetica,sans-serif;}

