h4 {margin: 8px; font-size: 16px;}

dl {padding-left: 10px;}

dd {margin-left: 20px;}

/*base-------------------------------------------------------------*/



/*menus-----------------------------------------------------------*/
#menubar {/*background: #bf2000;*/ background: #000000; padding: 5px; -webkit-border-radius: 5px; -moz-border-radius: 5px; border-radius: 5px;}

/* Level 1 */
.menu-dropdown { margin-bottom: -10px; }

.menu-dropdown li.level1 {
	/*margin-right: 10px;*/
	margin-right: 20px;
	margin-left: 20px;
	padding-bottom: 10px;
}

.menu-dropdown a.level1,
.menu-dropdown span.level1 {
	border: none;
	color: #fff;
	font-family: Calibri, sans-serif;
	font-weight: bold;
	text-transform: uppercase;
	font-size: 12px;
}

/* Set Active */
.menu-dropdown li.active .level1 { /*color: #fff; background: #fe7e00;*/ color: #ffa600;}

/* Set Hover */
.menu-dropdown li.level1:hover .level1,
.menu-dropdown li.remain .level1 { /*color: #bf2000; background: #ffd300;*/ color: #ffa600;}

/* Drop-Down */
.menu-dropdown .dropdown {
	top: 35px;
	/*border-top: 1px solid #ff5a39;*/
	left:-68px;
}

.menu-dropdown .dropdown-bg > div {
	padding: 0 5px;
	border: 1px solid transparent;
	border-top: none;
	background: #FFA600;
}

/* Level 2 */
.menu-dropdown li.level2 { 
	margin: 0 5px;
	border-top: 1px solid #B97800;
}
.menu-dropdown li.level2:first-child { border: none; }

.menu-dropdown a.level2,
.menu-dropdown span.level2 , .menu-dropdown a.level3,
.menu-dropdown span.level3 { color: #fff; }

/* Set Hover */
.menu-dropdown a.level2:hover { color: #ffd300; }

/* Set Current */
.menu-dropdown a.current.level2 { font-weight: bold; } 

/* Set Hover */
.menu-dropdown a.level3:hover { color: #ffd300; }

/* Set Current */
.menu-dropdown a.current.level3 { font-weight: bold; }

/* Link */
.menu-sidebar a,
.menu-sidebar li > span { color: #fff; }

/* Current */
.menu-sidebar a.current { font-weight: bold; }

/* Level 1 */
.menu-sidebar li.level1 { border-top: none; }
.menu-sidebar li.level1:first-child { border-top: none; } 

/*menus*-------------------------------------------------------------/



/*tools----------------------------------------------------------------*/
form.box fieldset { border: 1px solid #fea900; border-radius: 3px; }

.button-default {
	padding: 3px 10px;
	border: none;
}

ul.zebra > li,
table.zebra tbody td { border-bottom: 1px solid #fea900; }
ul.zebra > li:first-child,
table.zebra tbody tr:first-child td { border-top: 1px solid #fea900; }

ul.zebra > li.odd,
table.zebra tbody tr.odd { background: #fede3e; }
ul.zebra > li:nth-of-type(odd),
table.zebra tbody tr:nth-of-type(odd) { background: #fede3e; }

table.zebra caption { color: #fff; }

#system small { color: #fff; }
/*tools----------------------------------------------------------------*/

/*system------------------------------------------------------------------*/
#system .title a { color: #fff; }

#system .item > header .meta { color: #bf2000; }

#system .pagination a,
#system .pagination strong { border: none; }

ul.line > li { border-top: none; }

#system .items .item {
	margin-top: 12px;
	padding-top: 18px;
	border-top: 1px dashed #fff;
}

#system .items .leading .item {
	padding-bottom: 12px;
	margin-bottom: 18px;
	border-bottom: 1px dashed #fff;
}

#system .item-list { border-top: 1px dashed #fff; }

.searchbox {
	width: 100px;
	height: 30px;
	padding: 0 25px;
	border: 1px solid #ddd;
	background:#fff url(../images/searchbox_magnifier.png) 0 50% no-repeat;
}



/*modules------------------------------------------------------------------*/
.mod-box {
	padding: 15px 15px 0 15px;
	margin-bottom: -1px;
	margin-top: -70px;
	border: none;
	/*background:#fede3e url(../images/images/gradient_02.jpg) repeat-x;
	border-top: 1px solid #ff5a39;*/
}

.mod-box h1, .mod-box h2, .mod-box h3, .mod-box h4, .mod-box h5, .mod-box h6 {color:#fee97e;}

